const Customer = (props) => {


  return (
      <div>
          <h2>{props.customer.name}</h2>
          <p><img sr={props.customer.image} /></p>
          <p>{props.customer.birthday}</p>
          <p>{props.customer.gender}</p>
          <p>{props.customer.job}</p>
      </div>
  )
}
export default Customer;
